import React from 'react';
import { Card, Icon, Image, Header, Grid, Divider } from 'semantic-ui-react'
import '../App.css';

import Anuska from '../static/Anuska.jpeg';
import Ashma from '../static/Ashma.jpeg';
import Haack from '../static/Haack.jpg';
import Pramila from '../static/Pramila.jpg';
import Rijan from '../static/Rijan.jpg';
import Sadikshaya from '../static/Sadikshya.jpg';
import Sarina from '../static/Sarina.jpeg';
import Sumit from '../static/Sumit.jpeg';

const OfficersCard = (props) => {
	const imgSrc = props.img
	const link = props.link;
	const name = props.name;
	const title = props.title;
	const joinDate = props.date;
	const description = props.description;

	return (
			<Card className = 'divCard'>
			    <Image src={imgSrc} size = 'medium'/>
			    <Card.Content>
			      <Card.Header as ='h2'>{name}</Card.Header>
			      <Card.Meta>
			      	<Card.Header><Header>{title}</Header></Card.Header>
			        <span className='date'>Joined in {joinDate}</span>
			      </Card.Meta>
			      <Card.Description>
			       {description}
			      </Card.Description>
			    </Card.Content>
			    <Card.Content extra>
			        <a href = ''><Icon name='facebook'/></a>
			        <a href = ''><Icon name='twitter' /></a>
			        <a href = ''><Icon name='instagram' /></a>
			        <a href = ''><Icon name='mail' /></a>
			    </Card.Content>
	  		</Card>
 )};

class Officers extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      activeContainer: 'Home'
    };
  };

  render() {
    return(
    	<div>
	    		<Card.Group centered>
					<OfficersCard
			        	name = {'Dr. Barry Haack'}
			        	title = 'Faculty Advisor'
			        	img = {Haack}
			        	description = 'They call him Mr.Fibbs'
			        	date = {2019}/>
		        </Card.Group>
	    		<Card.Group centered>
					<OfficersCard
			        	name = {'Sarina'}
			        	title = 'President'
			        	img = {Sarina}
			        	description = 'Everyone Calls Her Musa'
			        	date = {2019}/>
			        <OfficersCard
			        	name = {'Anuska'}
			        	title = 'Vice President'
			        	img = {Anuska}
			        	description = 'Everyone Calls Her Musa'
			        	date = {2019}/>
			        <OfficersCard
			        	name = {'Sadikshaya'}
			        	title = 'Treasurer'
			        	img = {Sadikshaya}
			        	description = 'Everyone Calls Her Musa'
			        	date = {2019}/>
		        </Card.Group>
		        <Divider hidden/>
		        <Card.Group centered >
					<OfficersCard
			        	name = {'Ashma'}
			        	title = 'Secratary'
			        	img = {Ashma}
			        	description = 'Everyone Calls Her Musa'
			        	date = {2019}/>
			        <OfficersCard
			        	name = {'Pramila'}
			        	title = 'Community Service Manager'
			        	img = {Pramila}
			        	description = 'Everyone Calls Her Musa'
			        	date = {2019}/>
			        <OfficersCard
			        	name = {'Rijan'}
			        	title = 'Event Manager'
			        	img = {Rijan}
			        	description = 'Everyone Calls Her Musa'
			        	date = {2019}/>
			        <OfficersCard
			        	name = {'Sumit'}
			        	title = 'Advisor'
			        	img = {Sumit}
			        	description = 'Everyone Calls Her Musa'
			        	date = {2019}/>
		        </Card.Group>
	    </div>
  )};
};

export default Officers;
